import React from 'react';
import ReactDOM from 'react-dom';

const name = "Sushant Mudad";
const curDate = new Date();


ReactDOM.render(
    <>
    <h1>Hello World! I A'm {name}.</h1>
    <p>Current Date is : {curDate}</p>
    </>,
    document.getElementById("root")
);
